import React from 'react';

const Home = ()=> {
  return (
    <div className='home'>
      <div className='card home-card'>
      <h5>Amber</h5>
      <div className='card-image'>
        <img src="https://images.unsplash.com/photo-1545721264-44e85e25bacc?ixid=MXwxMjA3fDB8MHxzZWFyY2h8MTl8fGxvdmV8ZW58MHwyfDB8&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60"/>
      </div>
      </div>
    </div>
  );
}

export default Home;
